	const user = useSelector((state) => state.authReducer.user);
	const posts = useSelector((state) => state.userReducer);

	const dispatch = useDispatch();

	useEffect(() => {
		dispatch(AllPost());
	});

	const AllPost = () => {
		console.log(posts);
	}

	return (
		<div id="HomeForm">
			<NavBarHome/>
			<div className="Post">
				<NewPost/>
